// ViewUsersComponent.js
import React, { useState, useEffect } from 'react';
import AdminService from '../../services/AdminService';

const ViewUsersComponent = ({ travelPlanId }) => {
  const [registeredUsers, setRegisteredUsers] = useState([]);

  useEffect(() => {
    const fetchRegisteredUsers = () => {
      AdminService.getRegisteredUsers(travelPlanId)
        .then((response) => {
          setRegisteredUsers(response.data);
        })
        .catch((error) => {
          console.error('Error fetching registered users:', error);
        });
    };

    fetchRegisteredUsers();
  }, [travelPlanId]);

  return (
    <div>
      <h2 className='text-center'>Registered Users</h2>
      <ul>
        {registeredUsers.map((user) => (
          <li key={user.user_id}>
            {user.fullName} - {user.email}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ViewUsersComponent;
